import React, {Component} from 'react';
import "./directory.styles.scss";
import MenuItem from "../menu-item/menu-item.component"
class Directory extends Component {
    constructor(props){
        super();
        this.state = {
            sections: [
                {
                    title: "Earrings",
                    imageUrl: "https://i.etsystatic.com/19638897/r/il/f6952c/2199945255/il_1588xN.2199945255_26w7.jpg",
                    id: 1
                },
                {
                    title: "Necklace",
                    imageUrl: "https://i.etsystatic.com/19638897/r/il/afda4a/2112467617/il_794xN.2112467617_g479.jpg",
                    id: 2
                },
                {
                    title: "Desk Buddy",
                    imageUrl: "https://i.etsystatic.com/19638897/r/il/f6952c/2199945255/il_1588xN.2199945255_26w7.jpg",
                    id: 3
                },
                {
                    title: "Polymer Clay Charms",
                    imageUrl: "https://i.etsystatic.com/19638897/r/il/f6952c/2199945255/il_1588xN.2199945255_26w7.jpg",
                    id: 4
                },
                {
                    title: "Resin Charms/Keychain",
                    imageUrl: "https://i.etsystatic.com/19638897/r/il/2ccb4c/1997667599/il_1588xN.1997667599_lt5k.jpg",
                    id: 5
                }
            ]
        }
    }
    render(){
        return (
            <div className="directory-menu">
                {this.state.sections.map(({title, imageUrl, id}) => {
                    return <MenuItem key={id} title={title} imageUrl={imageUrl}/>
                })}
            </div>
        )
    }
}
export default Directory;
